import React, { Component } from "react";

class Like extends Component {
  render() {
    let classes = "fa fa-heart";
    if (!this.props.liked) classes += "-o";
    return (
      <i
      style={{cursor: 'pointer'}}
        onClick={this.props.onToggleLike}
        className={classes}
        aria-hidden="true"
      ></i>
    );
  }
}

export default Like;
